import React from "react";
import { FiSearch, FiUser } from "react-icons/fi";
const Header = () => {
  return (
    <div className="flex fixed justify-between  w-full  text-white z-10 bg-gray-700 py-5 ">
      <div className="flex items-center pl-3">
        <div className="font-bold  w-20 ">MyPass</div>
      </div>
      <div className=" border-4 border-white px-6 rounded-6">
        <input className=" rounded-lg py-1 text-center text-slate-500   resize-none h-8" />
      </div>
      <div className="pr-2 ">
        <FiUser size={30} />
      </div>
    </div>
  );
};

export default Header;
